import React, { useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import { useEffect,useState } from 'react'

import axios from "axios";

//map
//from,to text fields
//search button

//farecomparision button
//farecomparision page


const HomePage = () => {
  const [data, setData] = useState(null);
  const [email, setEmail] = useState("");
  var ref = useRef(null);
  //const myElement = useRef(null);
  const next = useNavigate();
  function sayHello() {
    var startLocation = ((document.getElementById("start") as HTMLInputElement).value);
    var endLocation = ((document.getElementById("end") as HTMLInputElement).value);
    console.log(startLocation,endLocation);
    fetchData();
  }
  useEffect(() => {
    var elementStart = (document.getElementById("start") as HTMLInputElement).value;
    let elementEnd = (document.getElementById("end") as HTMLInputElement).value;
    //console.log(elementStart);
    if (elementStart) {
    console.log(elementStart);
    }
    if (elementEnd) {
      console.log(elementEnd);
    }

    

    
    
  }, []);
  async function fetchData() {
    if (email) {
      console.log(email);


      setEmail("");
      
    } else {
      alert("  Password and Email Cannnot be blank");
    }
    const response = await fetch("http://127.0.0.1:5000/hello");
    const json = await response.json();
    setData(json);
    console.log(json);

    next('/listing',{state:json});
  }
  return (
    <div>
        <div id="map"></div>
    <label htmlFor="start">Start: </label>
    <input type="text" id="start"  ref={ref} value={email} onChange={(e) => setEmail(e.target.value)}/>
    <br/>
    <label htmlFor="end">End: </label>
    <input type="text" id="end" value="Los Angeles, CA" ref={ref}/>
    <br/>
    <button id="submitBtn" onClick={sayHello}>Submit</button>

      {data ? <div>{JSON.stringify(data)}</div> : <div>Loading...</div>}
    </div>
  );
};

export default HomePage;
